import React from 'react'

function Nav() {

    return (
        <div className="nav">
            <img
            className="nav__logo"
            src="https://www.google.com/search?q=netflix+logo&newwindow=1&sa=X&rlz=1C5CHFA_enUS876US876&hl=en&sxsrf=ALeKk02LCZGoDq1JQ_ZcgNlwvGKKiiY7Nw:1604636375436&tbm=isch&source=iu&ictx=1&fir=Jcb8EromgfzjDM%252Chu5P0LmCR3w2wM%252C_&vet=1&usg=AI4_-kShbdpMTrn0a6VyfzXmXwxLLYKsXg&ved=2ahUKEwjm3ZqpiO3sAhX2CzQIHUlbA6YQ9QF6BAgNEFg&biw=1440&bih=713#imgrc=Jcb8EromgfzjDM"
            alt="Netflix Logo"
            />
        </div>
    );
}

export default Nav;
